int main(void){
  int i,j,n,m,k,a,b,c,h,w,r=0,l,t;
  int fd[524288]={0},bd[524288]={0};
  char s[524288];
  scanf("%d%d%d%s",&n,&k,&c,&s[1]);
  i=1;t=0;
  while(i<=n){
    if(s[i]=='x'){i++;continue;}
    t++;
    fd[i]=t;
    i+=(c+1);
  }
  if(t>k){printf("");return 0;}
  for(i=2;i<=n;i++){fd[i]=max(fd[i],fd[i-1]);}

  i=n;t=0;
  while(i>=1){
    if(s[i]=='x'){i--;continue;}
    t++;
    bd[i]=t;
    i-=(c+1);
  }
  if(t>k){printf("");return 0;}
  for(i=n-1;i>=1;i--){bd[i]=max(bd[i],bd[i+1]);}

  for(i=1;i<=n;i++){
    if(fd[i-1]!=fd[i] && bd[i+1]!=bd[i]){
      printf("%d\n",i);
    }
  }
  return 0;
}
